import React from 'react'
import './Mission.css'


function Mission() {
  return (
    <div className='mission'>

        <h1>Our mission</h1>
        <p>At EduLearn, our mission is to make education accessible, engaging, and effective for everyone. We strive to provide top-notch educational resources that empower learners to achieve their full potential. By fostering a love for learning and supporting continuous development, we aim to create a brighter future for individuals and communities alike.</p>

    </div>
  )
}
export default Mission
